import Vue from 'vue'
import VueRouter from 'vue-router'

// Importa tus componentes
import Inicio from './components/Inicio.vue'
import Nosotros from './components/Nosotros.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Inicio',
    component: Inicio
  },
  {
    path: '/nosotros',
    name: 'Nosotros',
    component: Nosotros
  }
]

const router = new VueRouter({
  routes
})

export default router
